This species is widely distributed within the Nearctic (e.g., Whitfield 2006 , Fernandez-Triana 2010 , Yu et al. 2012 , Fernandez-Triana et al. 2014 ), and is also reported from Finland (
Hellen 1977
), Peru ( de Huiza 1995 ), and was introduced to Hawai ( Yu et al. 2012 ). Here we present additional information about the distribution of this species in Canada, including one new provincial record (AB), based on examined specimens from the BIO and CNC collections. Data for those specimens was extracted from BOLD.
